import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Prices, About, Navbar, Training, Contacts, Footer } from './components';
import './App.css';
import Page_training from './components/page';


const App = () => {
  return (
    <div className='App'>
      <Navbar />
      <About />
      <Router>
            <Switch>
                <Route exact path="/" component={Home} />
                <Route path="/about" component={About} /> {/* Добавьте маршрут для страницы О нас */}
                <Route path="/contact" component={Contact} />
            </Switch>
        </Router>
      <Training />
      <Prices />
      <Contacts />
      <Footer />
    </div>
  )
}

export default App
